CREATE DEFINER=`mm_team03_02`@`%` PROCEDURE `GetCustomerPurchaseHistory`(
 IN p_customer_id INT,
    OUT Total_orders INT,
    OUT Total_amount DECIMAL(10, 2),
    OUT Average_amount DECIMAL(10, 2)
)
BEGIN

    DECLARE v_total_orders INT DEFAULT 0;
    DECLARE v_total_amount DECIMAL(10, 2) DEFAULT 0.0;
    DECLARE v_average_amount DECIMAL(10, 2) DEFAULT 0.0;


    SELECT COUNT(*), SUM(p.Amount)
    INTO v_total_orders, v_total_amount
    FROM OrderDetails od
    JOIN Payment p ON od.OrderNum = p.OrderNum
    JOIN PaymentProfiles pp ON p.PaymentProfileID = pp.PaymentProfileID
    JOIN Customers c ON pp.CustomerID = c.CustomerID
    WHERE c.CustomerID = p_customer_id;

    IF v_total_orders > 0 THEN
        SET v_average_amount = v_total_amount / v_total_orders;
    END IF;

    SET Total_orders = v_total_orders;
    SET Total_amount = v_total_amount;
    SET Average_amount = v_average_amount;
END ;;
