CREATE DEFINER=`mm_team03_02`@`%` PROCEDURE `QuantityByCustNCatID`(
    IN p_customer_id INT,
    IN p_category_id INT
)
BEGIN
    CREATE TEMPORARY TABLE temp_result (
        Quantity INT,
        CategoryName VARCHAR(45),
        ProductID INT,
        CategoryID INT
    );
INSERT INTO temp_result (Quantity, CategoryName, ProductID, CategoryID)
     SELECT od.Quantity, cg.CategoryName, od.ProductID, p.CategoryID
    FROM OrderDetails od
    JOIN Product p ON od.ProductID = p.ProductID
    JOIN Category cg ON p.CategoryID = cg.CategoryID
    WHERE od.OrderNum IN (
        SELECT o.OrderNum
        FROM OrderDetails o
        JOIN Payment p ON o.OrderNum = p.OrderNum
        JOIN PaymentProfiles pp ON p.PaymentProfileID = pp.PaymentProfileID
        JOIN Customers c ON pp.CustomerID = c.CustomerID
        WHERE c.CustomerID = p_customer_id
    )
    AND p.CategoryID = p_category_id;
SELECT * FROM temp_result;
    DROP TEMPORARY TABLE IF EXISTS temp_result;

END ;;
